function Footer() {
    return(
        <footer>
            <div className="footer-line"></div>
            <div className="main">
                <div className="text">
                    <p className="desc">uzbedev@gmail.com</p>
                    <p className="ldesc">Web Developer</p>
                </div>
            </div>
        </footer>
    )
}
export default Footer;
